introtext:
Трикветр символизирует равновесие добра и зла в человеческом мире, а также бесконечное течение бытия. В кельтской культуре и мифологии знак символизирует гармонию единения физического и духовного начала человека.

Троичный узел используется в качестве оберега, так как способен наделить своего владельца решительностью, сберечь от сглаза и порчи, а также притянуть удачу.

притягивает удачу;
наделяет уверенностью, чтобы с легкостью достигать поставленных целей.;
пробуждает умственные способности;
улучшает здоровье;
нормализует психоэмоциональное состояние;
помогает найти выход из трудной жизненной ситуации.
Значение рун: Р- символизирует совершенство, счастье, благополучие. Призывает расслабиться и успокоится, не суетиться. Все идет в правильном направлении. 
Х с закрытым верхом - земля предков, наследие, продолжительность жизни. 
С- оберег, приносящий добро 
